import React from "react";
import Breweries from "../breweries/Breweries";
import Search from "../breweries/Search";
import Sidebar from "../layout/Sidebar";

const Home = props => {
  return (
    <div className="row">
      <Sidebar />
      <main
        className="col-12 col-md-9 ml-sm-auto col-lg-10 px-4"
        role="main"
        style={styles}
      >
        <Search />
        <Breweries />
      </main>
    </div>
  );
};

const styles = {
  backgrouungColor: "#ffc107"
};

Home.propTypes = {};

export default Home;
